var CollationZh = {
    inited: false,
    table: null,
    init: function () {
        if (this.inited)
            return;

        // Load sequence into table
        this.table = {};
        var seq = 0;
        for (var c in seq_pinyin) {
            c = seq_pinyin.charCodeAt(c);
            if (c == 32) {
                ++seq;
                continue;
            }
            this.table[c] = seq;
        }

        this.inited = true;
        console.info('CollationZh inited')
    },
    compare: function (x, y) {
        this.inited || this.init();

        var i, xseq, yseq, d;
        for (i = 0; i < x.length && i < y.length; ++i) {
            // Find sequence
            if (x.charCodeAt(i) in this.table) {
                xseq = this.table[x.charCodeAt(i)];
            } else {
                xseq = -1;
            }
            if (y.charCodeAt(i) in this.table) {
                yseq = this.table[y.charCodeAt(i)];
            } else {
                yseq = -1;
            }

            // Compare
            if (xseq == -1 && yseq == -1) {
                d = x.charCodeAt(i) - y.charCodeAt(i);
            } else {
                d = xseq - yseq;
            }

            if (d != 0)
                return d;
        }

        // Different length
        if (x.length == y.length)
            return 0;
        else if (i >= x.length)
            return -1;
        else
            return 1;
    }
};
